import React from "react";
import withStyles from "@material-ui/core/styles/withStyles";
import { styles } from "./styles";

interface ILink {
    classes: {
        link: string,
        disabled: string
    },
    href: string,
    className?: string,
    target?: string,
    disabled?: boolean,
    children: JSX.Element[] | JSX.Element | string
    onClick?: () => void
}

const Link = ({ classes, href, className = "", disabled = false, target, children, onClick }: ILink) => {
    return (
        <a
            href={href}
            target={target}
            className={`${className} ${classes.link} ${disabled ? classes.disabled : ""}`}
            onClick={onClick}
        >
            {children}
        </a>
    );
};

export default withStyles(styles, { withTheme: true })(Link);
